import Link from 'next/link';

const Index = () => (
  <div>
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
    </ul>
    <h1>Welcome to Bitcoin Price</h1>
  </div>
);

export default Index;
